css:
/* TwineForge Neon base */
#VarStateContainer.skin-twineforge-neon,
#VarStateContainer.skin-twineforge-neon-pulse{
  --twine-neon: #00ff80;
  --twine-neon-dim: #00cc66;
  --twine-bg: #0b0f0d;
  color: #eafff4;
  background: radial-gradient(1200px 800px at 50% 0%, rgba(0,255,128,.06), transparent 60%),
              radial-gradient(900px 600px at 0% 100%, rgba(0,128,64,.08), transparent 70%),
              var(--twine-bg);
}

/* Center logo watermark */
#VarStateContainer.skin-twineforge-neon::before,
#VarStateContainer.skin-twineforge-neon-pulse::before{
  content: "";
  position: absolute;
  top: 50%; left: 50%;
  transform: translate(-50%, -50%);
  width: min(70%, 420px);
  aspect-ratio: 1 / 1;
  background-repeat: no-repeat;
  background-position: center center;
  background-size: contain;
  opacity: .15;
  pointer-events: none;
  z-index: 0;
}


/* Elevate content above logo */
#VarStateContainer.skin-twineforge-neon *,
#VarStateContainer.skin-twineforge-neon-pulse *{
  position: relative;
  z-index: 1;
}

/* Controls glow */
#VarStateContainer.skin-twineforge-neon .th-btn,
#VarStateContainer.skin-twineforge-neon select,
#VarStateContainer.skin-twineforge-neon input[type="text"],
#VarStateContainer.skin-twineforge-neon input[type="search"],
#VarStateContainer.skin-twineforge-neon-pulse .th-btn,
#VarStateContainer.skin-twineforge-neon-pulse select,
#VarStateContainer.skin-twineforge-neon-pulse input[type="text"],
#VarStateContainer.skin-twineforge-neon-pulse input[type="search"]{
  border: 1px solid color-mix(in srgb, var(--twine-neon) 55%, white 0%);
  background: rgba(0, 20, 10, .55);
  box-shadow: 0 0 14px color-mix(in srgb, var(--twine-neon) 35%, black 65%),
              inset 0 0 6px color-mix(in srgb, var(--twine-neon) 18%, black 82%);
  border-radius: 10px;
  transition: box-shadow .15s ease, transform .06s ease;
}
#VarStateContainer.skin-twineforge-neon .th-btn:hover,
#VarStateContainer.skin-twineforge-neon select:hover,
#VarStateContainer.skin-twineforge-neon input[type="text"]:hover,
#VarStateContainer.skin-twineforge-neon input[type="search"]:hover,
#VarStateContainer.skin-twineforge-neon-pulse .th-btn:hover,
#VarStateContainer.skin-twineforge-neon-pulse select:hover,
#VarStateContainer.skin-twineforge-neon-pulse input[type="text"]:hover,
#VarStateContainer.skin-twineforge-neon-pulse input[type="search"]:hover{
  box-shadow: 0 0 18px color-mix(in srgb, var(--twine-neon) 60%, black 40%),
              inset 0 0 8px color-mix(in srgb, var(--twine-neon) 28%, black 72%);
}
#VarStateContainer.skin-twineforge-neon .th-btn:active,
#VarStateContainer.skin-twineforge-neon-pulse .th-btn:active{ transform: translateY(1px); }

/* Header tint */
#VarStateContainer.skin-twineforge-neon #th-header,
#VarStateContainer.skin-twineforge-neon-pulse #th-header{
  background: linear-gradient(180deg, rgba(0,255,128,.10), transparent);
  backdrop-filter: blur(1px);
}

/* Focus ring */
#VarStateContainer.skin-twineforge-neon :focus-visible,
#VarStateContainer.skin-twineforge-neon-pulse :focus-visible{
  outline: 2px solid var(--twine-neon);
  outline-offset: 2px;
  box-shadow: 0 0 20px color-mix(in srgb, var(--twine-neon) 55%, black 45%);
}

#VarStateContainer.skin-twineforge-neon::before{
  opacity: .15;
}
#VarStateContainer.skin-twineforge-neon::before{ background-image: url('data:image/png;base64,'); }

/* Broadened glow: header & tiny buttons */
#VarStateContainer.skin-twineforge-neon #th-header button,
#VarStateContainer.skin-twineforge-neon #th-header select,
#VarStateContainer.skin-twineforge-neon #th-header input,
#VarStateContainer.skin-twineforge-neon .th-pin,
#VarStateContainer.skin-twineforge-neon .th-find-nav button,
#VarStateContainer.skin-twineforge-neon-pulse #th-header button,
#VarStateContainer.skin-twineforge-neon-pulse #th-header select,
#VarStateContainer.skin-twineforge-neon-pulse #th-header input,
#VarStateContainer.skin-twineforge-neon-pulse .th-pin,
#VarStateContainer.skin-twineforge-neon-pulse .th-find-nav button{
  border: 1px solid rgba(0,255,128,.45);
  background: rgba(0, 20, 10, .55);
  box-shadow: 0 0 14px rgba(0,255,128,.30), inset 0 0 6px rgba(0,255,128,.12);
  border-radius: 10px;
}
